壁紙屋本舗のり付き壁紙の特徴<p>
独自ブレンドの糊をたっぷりと壁紙の裏に塗っているので、<br>
初心者の方でも位置調整がしやすく、施工時間に余裕を持って<br>作業できます。<br>
サンゲツや東リなどの国産壁紙メーカーから<br>
お求めやすい価格の壁紙を集めたお買い得壁紙と施工道具のセットです。<br><br>
●のり付き壁紙30m（幅約92cm）+壁紙の施工道具です。<br>
●のり付きなのですぐはれます。<br>
●のりが乾くまで何度でも位置調整が出来ます。<br>
<br>
<br>
壁紙が貼れる下地について<br>
今ある壁紙を剥がして貼るのが一番おすすめですが、壁紙の上からしっかり貼ることもできるように接着力を調整しています。
※一部の汚れ防止壁紙や、フッ素コート壁紙など接着しにくい壁紙がございますので、その場合は既存の壁紙を剥がして施工してください。<BR>
生のり付き壁紙の保管について<BR>
未開封の状態で２&#12316;３週間程度、直射日光の当たらない涼しい場所に保管してください。開封後はできるだけ早く施工してください。<br>
